xs.user.dir_cur = '/';

xs.user.dir_sub = function(dir) {
    var subdirs = [];
    $.each(xs.user.map_dir, function(k, v) {
        if (k.startsWith(dir)) {
            var path = k.substring(dir.length);
            if (path.indexOf('/') >= 0) {
                path = path.substring(0, path.length - 1);
                if (path.indexOf('/') < 0) {
                    subdirs.push(k);
                }
            }
        }
    });
    return subdirs;
};

